import React from "react";
import { useLocation,Link } from "react-router-dom";
import { Header } from "../components/header";


export function Home(){
    return(
        <div className="">
            <Header/>
                <Link to="revision" className="link-primary">Перегляд</Link>
                <Link to="additions" className="link-primary">Додати нову техніку</Link>
                <Link to="transfer" className="link-primary">Виписати наряд</Link>
        </div>
    );
}

export function Revision(){
    return(
        <div>
            <Header/>
            <h1>[Перегляд]</h1>
        </div>
    );
}

export function Additions(){
    return(
        <div>
            <Header/>
            <h1>[Додати нову техніку]</h1>
        </div>
    );
}

export function Transfer(){
    return(
        <div>
            <Header/>
            <h1>[Виписати наряд]</h1>
        </div>
    );
}



export function Whoops404(){
    let location = useLocation();
    console.log(location);
    return(
        <div>
            <h1>Resource not found at {location.pathname}</h1>
        </div>
    )
}
